import React from 'react'
import { Avatar, Button, IconButton } from '@mui/material'
import { Link } from 'react-router-dom';
import { useAppDispatch } from '../app/hooks';
import { logout } from '../features/auth/authSlice';

const Header = () => {
  let user = JSON.parse(localStorage.getItem('user') || 'null')
  const dispatch = useAppDispatch()

  const onLogout = () => {
    dispatch(logout())
    dispatch(reset())
    navigate('/')
  }

  return (
    <div className='bg-transparent flex p-5 justify-between items-center'>
      <div>
        <Link to='/'>
          <p className='text-xl sm:text-2xl underline font-serif text-[#b6fff4] font-bold uppercase'>Saadatu_blog</p>
        </Link>
      </div>
      {!user ? (
        <div className='space-x-3'>
          <Link to='login'>
            <Button sx={{fontSize: 13, padding: 0.3, color: '#b6fff4'}}>Login</Button>
          </Link>
          <Link to='register'>
            <Button sx={{fontSize: 13, padding: 0.3, color: '#b6fff4'}}>Register</Button>
          </Link>
        </div>
      ): (
        <div className='flex items-center'>
          <IconButton>
            <Avatar sx={{width: 28, height: 28, backgroundColor: '#b6fff4'}}>{user.name.charAt(0)}</Avatar>
          </IconButton>
          <Button sx={{color: '#b6fff4', }} >Logout</Button>
        </div>
      )}
    </div>
  )
}

export default Header;
